import './OrderDetails.css';

class OrderDetails extends Component{
    render(){
    
    
    return(
        
        <div className='OrderDetails'>
            <center>
            First Name: <input type="text" placeholder="Enter your first name"  required/><br></br><br></br>
            Last Name: <input type="text" placeholder="Enter your last name" required/><br></br><br></br>
            Quantity: <input type="number"  maxLength="10" placeholder="Quantity" required/><br></br><br></br>
            Mobile Number: <input type="text" maxLength="10" placeholder="enter your number" required/><br></br>
            Order Date: <input type="date" required/>
            <input type="submit" value="ADD" onSubmit="OrderDetails()" /> <input type="submit" value="RESET"/>
            </center></div>


)
}
}
export default OrderDetails;
